const NumberList = ({ pageQuantity, onPageChange}) => {

  const array = [];
  
  for (let i = 0; i <= pageQuantity; i++) {
    array.push(i);
  }

  // CAMBIAR LA PAGINA
const paginate = (num)=>{
  onPageChange(num)
}


  return (
    <ul style={ {"display" : "flex", "list-style": "none"} }>
      {array.map((num) => {
        return (<li key={num}onClick={()=> paginate(num)}> {num}</li>)
      })}
    </ul>
  );
};
export default NumberList;
